DROP TABLE IF EXISTS `dbo_cliente`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `dbo_cliente` (
  `CodigoCli` varchar(10) DEFAULT NULL COMMENT 'Codigo del Cliente',
  `RazonSocialCli` varchar(60) DEFAULT NULL COMMENT 'Razon Social',
  `CuitCli` varchar(13) DEFAULT NULL COMMENT 'CUIT',
  `IngBrutosCli` varchar(18) DEFAULT NULL COMMENT 'Ingresos Brutos',
  `Regis_IvaC` int(11) DEFAULT NULL COMMENT 'ID Condicion de IVA',
  `Regis_ListaPrec` int(11) DEFAULT NULL COMMENT 'ID Lista de Precios',
  `emailCli` varchar(50) DEFAULT NULL COMMENT 'EMail',
  `RazonSocialFlete` varchar(50) DEFAULT NULL COMMENT 'Flete',
  `Direccion` varchar(90) DEFAULT NULL COMMENT 'Direccion',
  `BarrioCli` varchar(30) DEFAULT NULL COMMENT 'Barrio',
  `LocalidadCli` varchar(40) DEFAULT NULL COMMENT 'Localidad',
  `DescrProvincia` varchar(40) DEFAULT NULL COMMENT 'Provincia',
  `CodigoPostalCli` varchar(10) DEFAULT NULL COMMENT 'Codigo Postal',
  `DescrPais` varchar(40) DEFAULT NULL COMMENT 'Pais',
  `Telefono` varchar(90) DEFAULT NULL COMMENT 'Telefono',
  `FaxCli` varchar(30) DEFAULT NULL COMMENT 'Fax',
  `PaginaWebCli` varchar(40) DEFAULT NULL COMMENT 'Pagina Web',
  KEY `login` (`emailCli`),
  KEY `usuario1` (`CodigoCli`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

